import { AppointmentList } from "./components/AppointmentList/AppointmentsList";
import { InputFields } from "./components/InputFields/InputFields";
import { GlobalStyle } from "./globalStyles/global"
import { useAppointments } from "../../hooks/useAppointments";

export function AppointmentsPage() {
  const { appointments, loading, error, updateAppointment, deleteAppointment } =
    useAppointments();

    if (loading) return <p>Loading...</p>;
  if (error) return <p>No appointments to show</p>;

  return (
    <div>
      <InputFields />
      <AppointmentList appointments={appointments} loading={loading} error={error} />
    </div>
  );
}
